description:
Award-winning director Brad Armstrong brings you a fun and flirty tale about Samantha - owner of a struggling medical clinic - who's looking for a better way to earn a living. Suddenly it comes to her... she'll open a Sperm Bank! Along with her staff of scorching-hot nurses, the women develop their own &quot;special&quot; way of collecting semen and quickly find themselves anointed as the queens of the &quot;Jizz Biz.&quot;

India Summer, Brad Armstrong, Danny Mountain, Ramon Nomar, Toni Ribas, Mischa Brooks, Kris Slater, Brandy Aniston, Rikki Six, Aleksa Nicole, Jessa Rhodes, Aaron Wilcox, Keni Styles


